import { Footer } from "./../components/footer";
import { Logo } from "./../components/Logo";
import React from "react";
import { bruh } from "../tmp";
import { Tabs, TabList, Tab, TabPanel, Box } from "@mui/joy";

export function Menu({}) {
  return (
    <div>
      <div className="h-screen w-full flex flex-col justify-center items-center">
        <Tabs aria-label="Basic tabs" defaultValue={0} size="lg" className="w-full h-full" orientation="vertical">
          <TabList>
            <Box className="flex justify-center py-3">Home</Box>
            <Tab>Breakfast</Tab>
            <Tab>Lunch</Tab>
            <Tab>Dinner</Tab>
            <Box className>Logo</Box>
          </TabList>
          <TabPanel value={0}>
            <b>First</b> tab panel
          </TabPanel>
          <TabPanel value={1}>
            <b>Second</b> tab panel
          </TabPanel>
          <TabPanel value={2}>
            <b>Third</b> tab panel
          </TabPanel>

        </Tabs>
      </div>

      <Footer />
    </div>
  );
}
